;; **
;;; ## Distribution
;; **

;; @@
(defn plot-size-dist [coll]
(let [dat {:degrees (compound-size coll t0 tmax :distribution)}]
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :degrees]]
         [:geom_histogram [:aes {:y :..density.. }] {:binwidth 2 :colour "black" :fill "white"}]
         [:geom_density {:alpha 0.2 :fill "red"}]
         [:xlab "Size"]
         [:ylab "Density"]
         [:theme_bw]
         [:ggtitle (str "Compound size distribution of " (element-name coll))])]
      {:width 5 :height 5})))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;thriving-forest/plot-size-dist</span>","value":"#'thriving-forest/plot-size-dist"}
;; <=

;; @@
(for [b broadcasters]
  (plot-size-dist b))
